DROP TABLE IF EXISTS `marathon_app`;
CREATE TABLE `marathon_app` (
  `app_id` varchar(32) NOT NULL COMMENT '应用id',
  `group_id` varchar(64) DEFAULT NULL COMMENT '应用组ID',
  `owner_id` varchar(32) DEFAULT NULL COMMENT '所属用户id',
  `owner_name` varchar(64) DEFAULT NULL COMMENT '所属用户名称',
  `vcluster_id` varchar(64) DEFAULT NULL COMMENT '所属集群id',
  `vcluster_name` varchar(64) DEFAULT NULL COMMENT '所属集群名称',
  `status` varchar(64) DEFAULT NULL COMMENT '应用状态（Running、Deploying、Suspended、Delayed、Waiting）',
  `instances` int(11) DEFAULT NULL COMMENT '应用实例数',
  `healthy` int(11) DEFAULT NULL COMMENT '健康实例数',
  `unhealthy` int(11) DEFAULT NULL COMMENT '不健康实例数',
  `running` int(11) DEFAULT NULL COMMENT '正在运行的实例个数',
  `staged` int(11) DEFAULT NULL COMMENT '等待mesos分配实例数',
  `depencies` varchar(255) DEFAULT NULL COMMENT '依赖应用（目前borg尚不支持）',
  `app_version` varchar(32) DEFAULT NULL COMMENT '版本号',
  `overcapacity` int(11) DEFAULT NULL COMMENT '运行数量超出实例数量',
  `unscheduled` int(11) DEFAULT NULL COMMENT '不在计划中的实例数',
  `unknown` int(11) DEFAULT NULL COMMENT '未知状态实例数',
  `labels` varchar(1024) DEFAULT NULL,
  `app_create_time` datetime DEFAULT NULL COMMENT '应用创建时间',
  `app_update_time` datetime DEFAULT NULL COMMENT '应用最近这一次更新时间',
  `update_time` datetime DEFAULT NULL COMMENT '记录更新时间',
  PRIMARY KEY (`app_id`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

